import { Box, Flex } from "@chakra-ui/react";
import { HamburgerIcon, SunIcon } from "@chakra-ui/icons";

const Nav = () => {
	return (
		<Flex as="header" alignItems="center" bg="rgb(32, 35, 38)" p="1em">
			<Flex as="nav">
				<HamburgerIcon color="#fff" w="25" height="25" />
				<SunIcon color="#fff" w="25px" height="25px" />
			</Flex>
		</Flex>
	);
};

export default Nav;
